function DashBordHooks() {
  const [state, setstate] = useState({ dasbord: {}, hospital: [] });

  useEffect(() => {
    axios.get("https://www.hpb.health.gov.lk/api/get-current-statistical")
      .then((response) => {
        console.log(response.data.data);
        setState({ res: response.data.data });
      })
      .catch(function (response) {});
  });

  return(
      <div>
          <h1>{state}</h1>
      </div>
  )
}

export default DashBordHooks;
